import './App.css';
import Home from './components/Home/Home';
import NavBar from './components/NavBar/NavBar';

function App() {
  return (
    <div>
      <header style={{position: 'sticky', top: '0'}}>
        <NavBar></NavBar>
      </header>
      <main>
        <Home></Home>
      </main>
    </div>
  );
}

export default App;
